import React, { useState } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPlus } from '@fortawesome/free-solid-svg-icons';
import './Board.css';
import Task from './Task'; // Importieren der Task-Komponente


const Board = () => {
  const [tasks, setTasks] = useState({
    todo: [
      { id: 1, title: 'Task 1', content: 'Lorem ipsum dolor sit amet.' },
      { id: 2, title: 'Task 2', content: 'Consectetur adipiscing elit.' },
    ],
    inProgress: [
      { id: 3, title: 'Task 3', content: 'Sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.' },
    ],
    done: [
      { id: 4, title: 'Task 4', content: 'Ut enim ad minim veniam.' },
      { id: 5, title: 'Task 5', content: 'Quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.' },
    ],
  });

  const [showTask, setShowTask] = useState(false);

  const toggleTask = () => {
    setShowTask(!showTask);
  };

  return (
    <div className="kanban-board">
      <div className="board-column">
        <div className="add-button" onClick={toggleTask}>
          <FontAwesomeIcon icon={faPlus} className="navbar-icon" />
          <p className="add-text">Add</p>
        </div>
        <h3 className="column-title">To Do</h3>
        <ul className="task-list">
          {tasks.todo.map(task => (
            <li key={task.id} className="task">
            <div className="task-title">
                        {task.title}
                        <button className={`priority-button ${task.priority.toLowerCase()}`}>
                            {task.priority}
                        </button>
              </div>
              <div className="task-content">{task.content}</div>
            </li>
          ))}
        </ul>
      </div>
      <div className="board-column">
        <div className="add-button" onClick={toggleTask}>
          <FontAwesomeIcon icon={faPlus} className="navbar-icon" />
          <p className="add-text">Add</p>
        </div>
        <h3 className="column-title">In Progress</h3>
        <ul className="task-list">
          {tasks.inProgress.map(task => (
            <li key={task.id} className="task">
              <div className="task-title">{task.title}</div>
              <div className="task-content">{task.content}</div>
            </li>
          ))}
        </ul>
      </div>
      <div className="board-column">
        <div className="add-button" onClick={toggleTask}>
          <FontAwesomeIcon icon={faPlus} className="navbar-icon" />
          <p className="add-text">Add</p>
        </div>
        <h3 className="column-title">Awaiting Feedback</h3>
        <ul className="task-list">
          {tasks.inProgress.map(task => (
            <li key={task.id} className="task">
              <div className="task-title">{task.title}</div>
              <div className="task-content">{task.content}</div>
            </li>
          ))}
        </ul>
      </div>
      <div className="board-column">
        <div className="add-button" onClick={toggleTask}>
          <FontAwesomeIcon icon={faPlus} className="navbar-icon" />
          <p className="add-text">Add</p>
        </div>
        <h3 className="column-title">Done</h3>
        <ul className="task-list">
          {tasks.done.map(task => (
            <li key={task.id} className="task">
              <div className="task-title">{task.title}</div>
              <div className="task-content">{task.content}</div>
            </li>
          ))}
        </ul>
      </div>
      <Task show={showTask} onClose={toggleTask} />
    </div>
  );
};

export default Board;
